1886ced346de75c8e369a750cf832399e78427fc:
fragment AuthUser on User {
  id
  email
  isActivated
  role
  __typename
}
mutation AuthLogIn($loginUserInput: LoginUserInput!) {
  result: login(loginUserInput: $loginUserInput) {
    user {
      ...AuthUser
      __typename
    }
    tokens {
      accessToken
      refreshToken
      __typename
    }
    __typename
  }
}

073cb77e694b0c965df6885e6480152d22a9a717:
fragment AuthUser on User {
  id
  email
  isActivated
  role
  __typename
}
query AuthGetUser {
  user: getCurrentUser {
    ...AuthUser
    __typename
  }
}
